CONCLUSÃO DE OBRAS:

Obras históricas iniciadas em governos anteriores e concluídas nesta gestão:

- Conclusão da Transposição do Rio São Francisco, levando liberdade a milhões de brasileiros, após 13 anos de espera;

- BR-154, em Minas Gerais: pavimentação de trecho de rodovia que liga Centro-Oeste e Sudeste, após 50 anos de espera;

-Conclusão da Nova Ponte do Guaíba (RS), após 10 anos do anúncio da obra;

- BR-163: fim dos atoleiros e de quase meio século de espera de conclusão de trechos que ligam o Mato Grosso ao Pará;

- Fim da "indústria das balsas" com a conclusão da Ponte do Abunã (Acre-Rondônia), esperada havia anos;
Obras diversas iniciadas em governos anteriores e concluídas nesta gestão.

. Novo Terminal do Aeroporto de Macapá;

. Modernização do Aeroporto de Marabá;

. Melhorias no Aeroporto de Foz do Iguaçu;

. Modernização do Aeroporto de Macaé;

. Aeroporto de Vitória da Conquista;

. BR-163/PA - 51 km de pavimentação;

. BR-365/MG - travessia de Monte Alegre;

. Viaduto sobre Linha Férrea - Avaré/SP;

. 5,6 km de adequação da Via Expressa de Florianópolis;

. BR-101/RJ - Viaduto da Casa da Moeda;

. BR-235/BA - 79 km de construção (Jeremoabo - Divisa BA/SE);

. Alinhamento do Berço 4 - Porto de Itajai/SC;

. Novo Cais de Atalaia no Porto de Vitoria/ES

. BR-426/PB - 7,7 km de implantação entre Nova Olinda e Santana dos Garrotes(

. BR-432/RR - 48,8 km de pavimentação entre Cantá e Novo Paraíso;

. BR-364/MT - Adequação da Travessia urbana de Rondonópolis/MT (3 km);

. BR-242/MT - Construção de 8 Pontes entre Nova Ubiratã e Santiago do Norte;

. BR-080/GO-346 km de adequação entre a Divisa DF/GO e Padre Bernardo;

. BR-154/MG - Pavimentação Ituiutaba - Crucilândia
Construção de 2 Viadutos sobre a EF-050 em Mogi-Guaçu;

. Novo Terminal do Aeroporto de Cascavel/PR;

. Liberação da Travessia Principal da 2a. Ponte do Guaíba (BR-116/290/RS);

. BR-116/RS - Duplicação de 27,1 km entre Guaíba e Pelotas;

. BR-222/PI - 47 km de Pavimentação entre Pirip

